SYskPII7DUNpry3fuRq3NaY1k1GYEccH+3i1xfM3NXixMcAPZYW1oWzo+UZU7PEjPSGfKS21aGPHH1naFV05NJPLHnFgtjSXldlbX/bwF6o911jB2di3fYHqE097oJ5QTfNK09QmblpliBaXaNuQf6dqLhnJlZ1JqofFxI9U32xs2tCX+X+ncljErAWVt8GP7/ciH+CkR+DSNwiffN9t72jbXc04fRc9hFC/5un/Bfg/7ayeMp8hAAAAAElFTkSuQmCC');

    background-position:center 28%;
    position:relative;
  }
  .overlay{position:absolute;inset:0;background:linear-gradient(to top, rgba(0,0,0,.6), rgba(0,0,0,.35));}

  /* Card layout inspired by the reference (not the same style) */
  .card{
    position:relative; z-index:1;
    width:min(380px,92vw);
    background:var(--card);
    border:1.5px solid var(--text);
    border-radius:16px;
    box-shadow:var(--shadow);
    overflow:hidden;
  }
  .body{padding:24px 18px 16px}
  h1{margin:0 0 10px;font-size:clamp(24px,6vw,30px);font-weight:800;color:var(--text);text-align:center;letter-spacing:.2px}
  .desc{text-align:center;color:var(--muted);font-size:14px;line-height:1.6;margin:0 0 16px}
  .actions{display:grid;gap:10px;padding:0 16px 18px}
  .btn{
    display:inline-flex;align-items:center;justify-content:center;gap:10px;
    border:2px solid var(--text);border-radius:12px;padding:12px 14px;
    font-weight:700; cursor:pointer; background:#fff; color:#111;
    box-shadow: 3px 3px 0 #111; transition: transform .06s ease;
  }
  .btn:active{transform:translateY(2px);box-shadow: 1px 1px 0 #111}
  .btn.primary{background:var(--text);color:#fff}
  .footer{border-top:1px solid var(--border);padding:10px 14px;text-align:center;color:#444;background:#fafafa}
  .mini{font-size:12px;opacity:.9}

  /* Dialog styling */
  dialog{ border:1.5px solid var(--text); border-radius:16px; padding:16px; width:min(92vw,720px); box-shadow:var(--shadow)}
  dialog::backdrop{ background:rgba(0,0,0,.45) }
  .q{display:grid; gap:8px; margin:10px 0; border:1px solid var(--border); border-radius:12px; padding:10px; background:#fff}
  .stars{display:flex; gap:6px; flex-wrap:wrap}
  .star{ width:38px;height:38px; display:grid; place-items:center; border-radius:10px; border:1px solid var(--border); cursor:pointer; background:#fff }
  .star.active{ background:#ffd54d; border-color:#ffd54d }
  label{ font-size:14px; color:#333 }
  input, textarea, select{ width:100%; border:1px solid var(--border); border-radius:10px; padding:10px 12px; background:#fff}
  .row{ display:grid; gap:10px; grid-template-columns:1fr }
  @media (min-width:560px){ .row{ grid-template-columns:1fr 1fr } }
  .ok{ color:#106a30; font-size:14px; margin-top:6px; display:none }
</style>
</head>
<body>
<section class="hero">
  <div class="overlay"></div>

  <div class="card">
    <div class="body">
      <h1>סטודיו דוראל אזולאי</h1>
      <p class="desc">ברוכים הבאים לסטודיו של דוראל .</p>
    </div>

    <div class="actions">
      <button class="btn" onclick="openRating()">⭐ דרגו אותנו</button>
      <a class="btn primary" id="wa" target="_blank" href="https://wa.me/9720723268073">💬 ווטסאפ</a>
    </div>

    <div class="footer">
      <div class="mini">© <span id="year"></span> סטודיו דוראל אזולאי</div>
    </div>
  </div>
</section>

<!-- Rating dialog -->
<dialog id="rating">
  <h3 style="margin:0 0 10px">דרגו אותנו</h3>
  <p style="margin:0 0 8px;color:#555">5 שאלות קצרות (1–5 כוכבים לכל שאלה). אם הממוצע גדול מ‑4, נעביר אתכם לביקורת בגוגל 🙏</p>
  <form id="rateForm">
    <div class="q">
      <label>1) שביעות רצון כללית</label>
      <div class="stars" data-name="q1"></div>
    </div>
    <div class="q">
      <label>2) מקצועיות והדרכה</label>
      <div class="stars" data-name="q2"></div>
    </div>
    <div class="q">
      <label>3) ניקיון וסביבה</label>
      <div class="stars" data-name="q3"></div>
    </div>
    <div class="q">
      <label>4) יחס ושירות</label>
      <div class="stars" data-name="q4"></div>
    </div>
    <div class="q">
      <label>5) תמורה למחיר</label>
      <div class="stars" data-name="q5"></div>
    </div>
    <div class="q">
      <label>הערה חופשית (לא חובה)</label>
      <textarea id="freeText" rows="3" placeholder="ספרו לנו בקצרה…"></textarea>
    </div>
    <div style="display:flex;gap:8px;flex-wrap:wrap;margin-top:8px">
      <button class="btn primary" type="submit">שליחה</button>
      <button class="btn" type="button" onclick="document.getElementById('rating').close()">סגירה</button>
    </div>
  </form>
</dialog>

<!-- CV dialog -->
<dialog id="cv">
  <h3 style="margin:0 0 10px">השארת קורות חיים</h3>
  <form id="cvForm">
    <div class="row">
      <div><label>שם מלא<input required name="name" placeholder="שם מלא"></label></div>
      <div><label>טלפון<input required name="phone" placeholder="050-0000000"></label></div>
    </div>
    <div style="margin-top:8px"><label>קורות חיים (PDF/Word)<input required name="file" type="file" accept=".pdf,.doc,.docx"></label></div>
    <div style="margin-top:8px"><label>הערות<textarea name="note" rows="3" placeholder="זמינות, תפקיד, ניסיון…"></textarea></label></div>
    <div style="display:flex;gap:8px;flex-wrap:wrap;margin-top:10px">
      <button class="btn primary" type="submit">שליחה</button>
      <button class="btn" type="button" onclick="document.getElementById('cv').close()">סגירה</button>
    </div>
    <div id="cvok" class="ok">הטופס נשלח (דמו). נחזור אליך בהקדם.</div>
  </form>
  <p style="color:#777;font-size:12px;margin-top:8px">אפשר לחבר שליחה אמיתית ל‑Google Sheets / n8n / מייל בכל רגע.</p>
</dialog>

<script>
  document.getElementById('year').textContent = new Date().getFullYear();

  // Build star widgets for 5 questions
  const values = {};
  for (const el of document.querySelectorAll('.stars')) {
    const name = el.dataset.name;
    values[name] = 0;
    for (let i=1;i<=5;i++) {
      const b = document.createElement('button');
      b.type = 'button';
      b.className = 'star';
      b.textContent = '★';
      b.addEventListener('click', () => setStars(el, name, i));
      el.appendChild(b);
    }
  }
  function setStars(container, name, n) {
    values[name] = n;
    [...container.children].forEach((btn, idx) => btn.classList.toggle('active', idx < n));
  }

  function openRating() { document.getElementById('rating').showModal(); }
  function openCV() { document.getElementById('cv').showModal(); }

  // Rating form submit with auto-redirect if average > 4
  const REVIEW_URL = "https://search.google.com/local/writereview?placeid=ChIJZ2KSBii7HRURMTKVTdJGT8w";
  document.getElementById('rateForm').addEventListener('submit', (e) => {
    e.preventDefault();
    const note = document.getElementById('freeText').value.trim();
    const nums = Object.values(values);
    const filled = nums.filter(n => n>0).length;
    if (filled < 5) { alert('נא לדרג את כל 5 השאלות'); return; }
    const avg = nums.reduce((a,b)=>a+b,0) / nums.length;
    // store locally
    localStorage.setItem('studio_rate_'+Date.now(), JSON.stringify({ ...values, avg, note, ts: new Date().toISOString() }));
    if (avg > 4) {
      window.location.href = REVIEW_URL;
    } else {
      alert('תודה! הדירוג התקבל.');
      document.getElementById('rating').close();
    }
  });

  // CV demo store
  document.getElementById('cvForm').addEventListener('submit', (e) => {
    e.preventDefault();
    const fd = new FormData(e.target);
    const name = fd.get('name'); const phone = fd.get('phone'); const note = fd.get('note');
    localStorage.setItem('studio_cv_'+Date.now(), JSON.stringify({name, phone, note, ts: new Date().toISOString()}));
    document.getElementById('cvok').style.display='block';
    setTimeout(() => { document.getElementById('cv').close(); document.getElementById('cvok').style.display='none'; }, 1200);
    e.target.reset();
  });
</script>
</body>
</html>
